import React, { useEffect, useState } from "react";
import "./App.css";
import ImageViewer
 from "./components/ImageViewer";
function App() {
  const [data, setData] = useState(
    {
      "copyright": "\nOrazio Mezzio\n",
      "date": "2023-10-29",
      "explanation": "What's happened to the Moon?  Within the last day, part of the Moon moved through the Earth's shadow.  This happens about once or twice a year, but not every month since the Moon's orbit around the Earth is slightly tilted.  Pictured here, the face of a full Hunter's Moon is shown twice from Italy during this partial lunar eclipse.  On the left, most of the Moon appears overexposed except for the eclipsed bottom right, which shows some familiar lunar surface details. In contrast, on the right, most of the (same) Moon appears normally exposed, with the exception of the bottom right, which now appears dark. All lunar eclipses are visible from the half of the Earth facing the Moon at the time of the eclipse, but this eclipse was visible specifically from Europe, Africa, Asia, and Australia, clouds permitting. In April, a total solar eclipse will be visible from North America.   Album: Selected partial lunar eclipse images sent in to APOD",
      "hdurl": "https://apod.nasa.gov/apod/image/2310/PartialLunarItaly_Mezzio_5524.jpg",
      "media_type": "image",
      "service_version": "v1",
      "title": "A Partial Lunar Eclipse",
      "url": "https://apod.nasa.gov/apod/image/2310/PartialLunarItaly_Mezzio_1080.jpg"
  }
  );


  return (
    <div className="App">
      <ImageViewer viewData={data}/>


    </div>
  );
}

export default App;
